import React from 'react';
import Lesson from './Lesson';

class Main extends React.Component {
    render() {
        const lessonList = [
            {
                name: 'Consolidated Job Portal by Golang',
                image: 'https://s3-ap-northeast-1.amazonaws.com/canadianintern.link/consolidated_job_portal.png',
                introduction: 'Designed and built a web service to get/post job openings from multiple platforms by Golang. Users can track their application.',
                URL: 'http://canadianintern.link/',
                sourcecode: 'https://github.com/KenObata/Golang-Web-Scraping',
            },
            {
                name: 'Sass',
                image: 'https://s3-ap-northeast-1.amazonaws.com/progate/shared/images/lesson/react/sass.svg',
                introduction: 'SassはCSSをより便利に効率的にするための言語です。',
                URL: '',
                sourcecode: 'https://github.com/KenObata/Golang-Web-Scraping',
            },
            {
                name: 'JavaScript',
                image: 'https://s3-ap-northeast-1.amazonaws.com/progate/shared/images/lesson/react/es6.svg',
                introduction: 'JavaScriptはフロントエンドだけでなく、サーバーサイドまで広い可能性を持つプログラミング言語です。',
                URL: '',
                sourcecode: 'https://github.com/KenObata/Golang-Web-Scraping',
            },
            {
                name: 'Research',
                image: 'https://s3-ap-northeast-1.amazonaws.com/progate/shared/images/lesson/react/react.svg',
                introduction: 'During Summer 2020, I have done a research project, investigating about Randomized Algorithm and Probability Analysis.',
                URL: '',
                sourcecode: 'https://github.com/KenObata/Golang-Web-Scraping',
            },
        ];

        return (
            <div className='main-wrapper'>
                <div className='main'>
                    <div className='copy-container'>
                        <h1>Welcome to Ken Obata's home page.</h1>
                        <h2>I'm a software developer. Currently interning at D-Wave System in Burnaby BC.
                        I am also studying Computer Science & Mathematics at University of Victoria.
                        </h2>
                    </div>
                    <div className='lesson-container'>
                        <h3>Here is my portofolio</h3>
                        {lessonList.map((lessonItem) => {
                            return (
                                <Lesson
                                    name={lessonItem.name}
                                    image={lessonItem.image}
                                    introduction={lessonItem.introduction}
                                    url={lessonItem.URL}
                                    sourcecode={lessonItem.sourcecode}
                                />
                            );
                        })}
                    </div>
                </div>
            </div>
        );
    }
}

export default Main;
